/**
 * Helper function used on each page refresh.
 *
 * It will re-populate Drupal.settings.jsui.user object and refresh user menu.
 *
 * @param customerWelcomeCallback
 * @param triggeredEvent {string}
 *   Event to be triggered.
 */
function customer_welcome(customerWelcomeCallback, triggeredEvent) {
  // Menu is hidden by default from css to prevent from showing all possible
  // items for logged in and logged out users.
  // Read the user status.
  Drupal.utils.fetchUserInfo();
  var updated_user_handler = function (event, data) {
    if (data) {
      var name = data['name'];
      var authenticated = data['authenticated'];
      var customer_manifest_id;
      if (typeof(data['customer_manifest_id']) != 'undefined') {
        customer_manifest_id = data['customer_manifest_id'];
      }
      if (typeof(customer_manifest_id) != 'undefined' && !$('body').hasClass('app-cc')) {
        Drupal.settings.jsui.manifestID = customer_manifest_id;
      }
      if (Drupal.g4debug) {
        Drupal.g4debug.populateManifest(customer_manifest_id);
      }
      if (data['customer_data']) {
        $.extend(true, Drupal.settings, {jsui: {user: data['customer_data']}});
      }
      else if (Drupal.settings.jsui && Drupal.settings.jsui.user) {
        delete Drupal.settings.jsui.user;
      }
      if (triggeredEvent) {
        $( Drupal ).trigger(triggeredEvent, [Drupal.settings.jsui.user]);
        g4Analytics_setDefaultDataLayerVars();
      }
      if (data['customer_data'] &&
        data['customer_data']['loyalty'] &&
        data['customer_data']['loyalty']['applicationStatus'] &&
        data['customer_data']['loyalty']['applicationStatus'] == 'approved') {
        $('body').removeClass('loyalty-na').removeClass('loyalty-off').addClass('loyalty-on');
      }
      else {
        $('body').removeClass('loyalty-na').removeClass('loyalty-on').addClass('loyalty-off');
      }
    }

    if (authenticated) {
      $('body').removeClass('not-logged-in').addClass('logged-in');
    }
    else {
      // If sales app is active, the logout was executed in a different tab.
      // Redirect user to homepage.
      if (Drupal.settings.jsui && Drupal.settings.jsui.search_params && Drupal.settings.jsui.search_params.role && Drupal.settings.jsui.search_params.role != 'ma') {
        window.location.href = Drupal.settings.basePath;
      }
      $('body').removeClass('logged-in').addClass('not-logged-in');
    }

    if (typeof(customerWelcomeCallback) == "function") {
      $.call(this, customerWelcomeCallback);
    }
    $(document).off('updated_user', updated_user_handler);
  };
  $(document).on('updated_user', updated_user_handler);
}

jQuery(document).ready(function(){
  if (!jQuery('body').hasClass('page-interactive-routemap')) {
    // Update account menu based on user login status.
    customer_welcome();
  }
});

