/**
 * Initialise login and logout behaviors.
 */
function customer_ajax_init() {
  if (!(jQuery('body').hasClass('app-ta') || jQuery('body').hasClass('app-cc'))) {
    $(document).on("click", "a[href='" + Drupal.settings.user_login_url + "'], a[href='/user-register']", function(e) {
      e.preventDefault();
      if (!customer_in_path()) {
        customer_login_modal();
      }
      else {
        customer_login_modal(true);
      }
    });
    if (!Drupal.settings.user_use_normal_logout) {
      jQuery("#mini-panel-g4_account_menu a[href*='" + Drupal.settings.user_logout_url + "']").click(function (e) {
        e.preventDefault();
        if (customer_in_path() && Drupal.settings.corporate_logout_confirmation) {
          var question = '<p>You must be logged in to MyAllegiant account in order to purchase Discount Departure Program fares. Are you sure you want to log out?</p>';
          var buttons = '<div id="discount-club-confirmation" class="ui-dialog-buttonset"><button class="yes_confirmation">Yes</button><button class="no_confirmation">No</button></div>';
          var dialog = $('<div></div>')
            .html(question + buttons)
            .dialog({
              autoOpen: true,
              modal: true,
              title: 'Confirmation',
              close: function () {
                $(this).remove();
              },
              open: function () {
                $(this).delegate('.yes_confirmation', 'click', function () {
                  // Let jsui decide what to do on logout.
                  if (Allegiant) {
                    $(Allegiant).trigger('discount_club_logout');
                  }
                  dialog.dialog("close");
                });
                $(this).delegate('.no_confirmation', 'click', function () {
                  dialog.dialog("close");
                });
              }
            });
        }
        else {
          customer_ajax_logout();
        }
      });
    }
    if (Drupal.settings.customer_login_callbacks) {
      Drupal.settings.customer_login_callbacks.push(customer_menu_reload_login);
    }
    if (Drupal.settings.customer_logout_callbacks) {
      Drupal.settings.customer_logout_callbacks.push(customer_menu_reload_logout);
    }
  }
}

/**
 * Logout js handler.
 *
 * @returns {boolean}
 */
function customer_ajax_logout() {
  try {
    // Patch needed after we updated Services module. Any POST requests against
    // a drupal service endpoint should have X-CSRF-Token header set. This token
    // should be available at : /services/session/token path.
    var currentPath = window.location.pathname;
    jQuery.ajax({
      url: Drupal.settings.basePath + "services/session/token",
      type: "get",
      dataType: "text",
      error: function (jqXHR, textStatus, errorThrown) {
      },
      success: function (token) {
        jQuery.ajax({
          type: "POST",
          dataType: 'json',
          beforeSend: function (request) {
            request.setRequestHeader("X-CSRF-Token", token);
          },
          url: Drupal.settings.basePath + "services/customer/auth/logout.json",
          success: function (data, dataStatus, ajax) {

            // Remove admin menu.
            jQuery('body').removeClass('admin-menu');
            jQuery('#admin-menu').remove();
            // Redirect on homepage if the user logged out on a page that is accesssible only by logged in customers.
            if (!customer_in_path()) {
              window.location.href = '/';
              return false;
            }
            if (Drupal.settings.customer_logout_callbacks) {
              for (i in Drupal.settings.customer_logout_callbacks) {
                try {
                  Drupal.settings.customer_logout_callbacks[i](data, dataStatus, ajax);
                } catch (e) {
                }
              }
            }
          },
          error: function (data, textStatus, errorThrown) {
            customer_menu_reload();
            if (!customer_in_path()) {
              window.location.href = '/';
            }
          }
        })
      }
    });
  } catch (e) {
  }
  return false;
}

