/**
 * Center ctools modal.
 *
 * @param {object} modal
 *   Modal object.
 */
function centerModal(modal) {
  var max_inner_width = false,
    absolute = false,
    inner_width = false,
    left = 20,
    modal_border_width = modal.width() - modal.find('#modal-content').width(),
    inner_width_raw = modal.find('#modal-content').css('width'),
    max_inner_width_raw = modal.find('#modal-content').css('max-width'),
    height = modal.height(),
    window_width = jQuery(window).width(),
    window_height = jQuery(window).height();

  modal_border_width = (modal_border_width < 50 ? modal_border_width : 50);
  if (inner_width_raw) {
    inner_width = parseInt(inner_width_raw.replace('px', ''));
  }
  if (max_inner_width_raw) {
    max_inner_width = parseInt(max_inner_width_raw.replace('px', ''));
  }
  var combo_inner_width = max_inner_width || inner_width;

  if (combo_inner_width) {
    left = (window_width - (combo_inner_width + modal_border_width)) / 2
  }

  var top = (window_height - height) / 2;
  if (top < 20) {
    top = 20;
    absolute = true;
  }

  if (left < 20) {
    left = 20;
  }

  modal.css('left', left);
  modal.css('width', window_width - left * 2);
  modal.css('top', top);

  // If the modal height is bigger than window height, we need to set the modal position as
  // absolute.
  if (absolute) {
    modal.css('position', 'absolute');
    $('body').scrollTop(0);
  }
  else {
    modal.css('position', 'fixed');
  }
}

/**
 * Creates the dialog with an AJAX call for the content.
 *
 * @param dialog
 *   The dialog object that needs to be created.
 * @param path
 *   The path from where we load the content of the dialog.
 * @param loading
 *   The loading dialog (because it needs to be closed).
 * @param ajaxPage
 *   Whether the page on which the dialog is opened is an ajax page or not
 *   (?ajax=true).
 * @param variables
 *   The variables to create the dialog: popupHeight, popupWidth,
 *   popupMaxHeight.
 */
function ajaxDialog(dialog, path, loading, ajaxPage, variables) {
  dialog.load(
    path,
    function (responseText, textStatus, XMLHttpRequest) {
      if ($(loading).data('uiDialog') || !$(loading).length) {
        createDialog(dialog, '', loading, variables);
      }
    }
  );
}


/**
 * Create the dialog from received content.
 *
 * Centers the dialog on the page.
 *
 * @param dialog
 *   The dialog object that needs to be created.
 * @param content
 *   The content of the dialog.
 * @param loading
 *   The loading dialog (because it needs to be closed).
 * @param variables
 *   The variables to create the dialog: popupHeight, popupWidth,
 *   popupMaxHeight.
 */
function createDialog(dialog, content, loading, variables) {
  return jQuery( dialog ).dialog({
    create: function (event, ui) {
      var loadingZIndex = loading.parent().css('z-index');
      jQuery( loading ).dialog('close');
      // Add max height to the modal on creation because maxHeight option
      // does not work.
      jQuery(this).css({
        'max-height': variables.popupMaxHeight,
        'overflow': "auto"
      }).append(content);
      if (loadingZIndex != 'auto' && loadingZIndex != '100000') {
        $(this).parent().css('z-index', loadingZIndex);
      }
      var triggerElem = dialog.data('triggerElem');

      // If the popup is the find voucher popup set overflow hidden.
      if (triggerElem.hasClass('find_vouchers_popup_iframe')) {
        jQuery(this).css('overflow', 'hidden');
      }
    },
    maxHeight: variables.popupMaxHeight,
    height: variables.popupHeight,
    modal: true,
    dialogClass: 'dialog-drupal',
    draggable: false,
    resizable: false,
    width: variables.popupWidth,
    zIndex: variables.zIndex,
    // Add a close listener to prevent adding multiple divs to the document.
    close: function (event, ui) {
      var triggerElem = dialog.data('triggerElem');

      if (triggerElem.context.className == 'find_vouchers_popup_iframe') {
        jQuery.post("user-info.php", function(data){ 
          if (!data['authenticated']) {
            window.location.reload();
          }
        }, "json");
      }

      dialog.remove();

      if (triggerElem != null) {
        triggerElem.focus();
      }
    },
    open: function (event, ui) {
      var $this = $(this),
          $body = $('body'),
          triggerElem = dialog.data('triggerElem');

      $this.attr('tabindex', 0);
      var dialogZIndex = $this.parent().css('z-index');
      if (dialogZIndex != 'auto' && dialogZIndex != '100000') {
        $this.parent().next().css('z-index', $this.parent().css('z-index') - 1);
      }

      $this.find('#content').removeAttr('id').addClass('content-modal');
      $this.find('#block-system-main').removeAttr('id');
      var title = $this.find('h1:not(".element-invisible")').remove().text().trim();
      
      // If no title was provided, try to find one in content.
      if (!$this.dialog('option', 'title')) {
        if (title) {
          $this.dialog('option', 'title', title);
        }
      }

      // Reposition the modal window after creation and upon window
      // resize or page scroll.
      repositionModal();

      // Scroll the popup content to the top.
      $this.scrollTop(0);

      if ($body.scrollTop() > top) {
        $body.animate({scrollTop: top}, 100);
      }
      Drupal.attachBehaviors('.dialog-drupal');
    }
  });
}

$(window).bind('resize', repositionModal);

/**
 * Repositions the open modal window to the center of the browser window.
 */
function repositionModal() {
  $('.ui-dialog.dialog-drupal').each(function () {
    // Avoid resize for drupal ctools modals that are sharing .ui-dialog class.
    if ($(this).parents('#modalContent').length) {
      return;
    }
    var $this = $(this);
    var $window = $(window);
    // Reposition horizontally.
    var modalInnerWidth = $this.innerWidth();
    // If we don't have any content loaded yet, we'll use 80% of window width to make sure that popup has enough space
    // to load content at full size.
    if (modalInnerWidth === 0) {
      modalInnerWidth = parseInt($window.width() - 42);
    }
    if ($this.width() + 64 > $window.width()) {
      $this.css('left', '20px');
    }
    else {
      $this.css('left', Math.floor(($window.width() - modalInnerWidth - 42) / 2 + $window.scrollLeft()) + 'px');
    }
    // Reposition vertically.
    if ($this.height() + 64 > $window.height()) {
      $this.css('top', '0');
      $this.css('position', 'absolute');
      $('body').scrollTop(0);
    }
    else {
      $this.css('top', Math.floor(($window.height() - $this.innerHeight() - 42) / 2 + 20));
      $this.css('position', 'fixed');
    }
  });
}

/**
 * Creates the loading dialog.
 *
 * @param loading
 *   The dialog object that needs to be created.
 */
function createLoadingDialog(loading) {
  jQuery( loading ).dialog({
    width: 200,
    modal: true,
    draggable: false,
    resizable: false,
    title: 'Loading...',
    dialogClass: 'hourglass hourglass-drupal no-close',

    // Add a close listener to prevent adding multiple divs to the document
    close: function (event, ui) {
      // remove div with all data and events
      loading.remove();
    },
    open: function () {
      var $dialog = $(this).parent();

      var maxZ = 100000;
      var existingDialogs = $('.ui-dialog');
      if (existingDialogs.length > 1) {
        $('.ui-dialog').each(function () {
          var thisZ = $(this).css('zIndex');
          thisZ = (thisZ === 'auto' ? (Number(maxZ) + 1) : thisZ);
          if (thisZ > maxZ) maxZ = thisZ;
        });
        $dialog.prev().css("zIndex", (maxZ + 1));
        $dialog.css("zIndex", (maxZ + 2));
      }
    }
  });
}

