/**
 * Construct the tooltip html to be placed on the page.
 *
 * @param message
 * @returns {string}
 */
function constructErrorHtml(message) {
  return '<div class="errors tooltip-errors"><div class="inner">' + message + '</div><span class="pointer"></span></div>';
}

/**
 * Remove the tooltip and unbind the tooltip event.
 *
 * @param selector
 */
function destroyTooltips(selector) {
  var input = $(selector);
  input.removeData('g4tooltip').parents('.form-item-error').find('div.tooltip-errors').remove();
  var errorDivId = input.attr('aria-describedby');
  if (errorDivId) {
    $('#' + errorDivId).remove();
  }
  input.removeClass('formToolTipErrors-processed g4tooltip-trigger focusError-processed');
  input.parents('.form-item-error').removeClass('form-item-error').find('.form-icon-attention').remove();
  input.removeAttr('aria-describedby');
  input.attr('aria-invalid', 'false');
}

/**
 * Remove errors from field and destroy the tooltip.
 */
function cleanTooltip() {
  if ($(this).hasClass('error')) {
    $(this).removeClass('error');
    $(this).siblings().removeClass('error');

    // Remove errors from all radio inputs.
    if ($(this).hasClass('form-radio')) {
      $(this).parents('.form-radios').find('.form-radio').removeClass('error');
      $(this).parents('.form-radios').find('.form-radio').each(function(index, item) {
        destroyTooltips($(item));
      });
    }
    destroyTooltips($(this));
  }
}

/**
 * Apply the tooltip message to the selected element.
 *
 * @param selector
 * @param message
 */
function applyTooltipMessage(selector, message) {
  customer_validation_add_aria_attributes(selector, message);
  Drupal.behaviors.formToolTipErrors.applyTooltipMessage(selector, message, {offset: [-10, 0]});
}

/**
 * Handler to highlight the first error.
 *
 * @param formId
 */
function scrollToError(formId) {
  var firstError = jQuery('.error:eq(0)', '#' + formId);
  firstError.mouseenter();
  firstError.focus();
}


/**
 * Displays tooltip messages for fields.
 *
 * This is to be used from
 *
 * @param data
 *   A json containing the following keys:
 *   - elements: array containing the selector and the message to be displayed.
 *   data example:
 *   {
 *     elements: {
 *       selector-1: "Message selector-1",
 *       selector-1: "Message selector-1"
 *     }
 *   }
 */
jQuery.fn.attachErrorTooltip = function (data) {
  // Do nothing if we do not receive any data. There must have been an error
  // somewhere and we didn't received any data.
  if (typeof(data) == "undefined" && data === null) {
    return;
  }

  // Apply tooltips.
  if(typeof(data.elements) != "undefined" && data.elements !== null) {
    jQuery.each(data.elements, function(selector, message) {
      applyTooltipMessage(selector, message);
    });
  }
};

