/**
 * Logging handlers.
 */
Drupal.event_logger = {
  format_data: function (category, action, label) {
    return {
      "category": category,
      "name": action,
      "msg": action + ' - ' + label,
      "label": label,
      "data": {
        category: category,
        action: action,
        label: label
      }
    };
  },
  log_event: function (data, timeout) {
    // Log event to timeline.
    if (typeof(Drupal.settings.log_events_to_timeline) == 'undefined'
      || Drupal.settings.log_events_to_timeline == true
    ) {
      var timeline_log_endpoint, manifest_id;
      if (typeof Drupal.settings.timeline_log_endpoint != 'undefined') {
        timeline_log_endpoint = Drupal.settings.timeline_log_endpoint;
        manifest_id = Drupal.event_logger.get_preferred_manifest_id();
      }
      if (!timeout) {
        timeout = 10000;
      }
      if (data && timeline_log_endpoint && manifest_id) {
        jQuery.ajax({
          url: Drupal.settings.basePath + timeline_log_endpoint + '/' + manifest_id,
          contentType: "application/json",
          type: "POST",
          timeout: timeout,
          data: JSON.stringify(data),
          dataType: "json"
        });
      }
    }

    // Log event to googleanalytics.
    if (typeof(Drupal.settings.log_events_to_ga) == 'undefined'
      || Drupal.settings.log_events_to_ga == true
    ) {
      g4Analytics_push(data.category, {'name': data.name, 'label': data.label});
    }
  },
  get_preferred_manifest_id: function() {
    // Get first available manifest id.
    // Check if we have search manifest id.
    if (typeof(Drupal.settings.jsui.search_hash) != 'undefined') {
      return Drupal.settings.jsui.search_hash;
    }

    // Check if we have customer manifest id.
    if (typeof(Drupal.settings.jsui.manifestID) != 'undefined') {
      return Drupal.settings.jsui.manifestID;
    }
    if (jQuery.cookie('customer_manifest_id')) {
      return jQuery.cookie('customer_manifest_id');
    }

    // Check if we have default session manifest id.
    if (jQuery.cookie('session_manifest')) {
      return jQuery.cookie('session_manifest');
    }

    // Should not get here, but we should have a backup.
    // There are no manifests. Create default session manifest id.
    // Copied from allegiant_cookies.js where this cookie should be created.
    var pattern = new RegExp('(\.[^.]+){2}$');
    var result = pattern.exec(Drupal.settings.cookieDomain);
    var cookies = {
      'session_manifest' : {
        'value' : Drupal.utils.getG4CookieValue('session_manifest', 43),
        'options' : {
          'expires' : null, // session
          'path' : Drupal.settings.basePath,
          'domain' : result[0],
          'secure' : true
        }
      }
    };
    options = getCookieOptions(cookies.session_manifest.options);
    jQuery.cookie('session_manifest', cookies.session_manifest.value, options);
    return cookies.session_manifest.value;
  }
};

