(function( $ ) {
  $(document).ready(function() {
    function header_relocate() {
      var window_top = $(window).scrollTop();
      if (window_top > 0) {
        var height = $('#fixed-header').outerHeight();
        $('#header-anchor').height(height);
      } else {
        $('#header-anchor').height(0);
      }
    }

    $(function () {
      var $body = $('body');
      if (!$body.hasClass('page-in-path') && !$body.hasClass('mobile-size') && !$body.hasClass('ios-device') && $('#loyalty-banner-box').length > 0) {
        $(window).on('resize scroll', Drupal.utils.throttleFn(header_relocate, 100));
        header_relocate();
      }
    });
  });
})( jQuery );

